    false,nt"url": null,nt"notes": "This report contains locations and water
    use at Browns Park NWR for 1999. A basic introduction highlighting the region that
    Browns Park NWR is a part of and the reason the refuge exists. Next the sources
    of water used to manage Browns Park NWR are quickly glossed over followed by data
    portraying the decreed water rights and the past years use of water for the marsh
     units that require artificial pumping. End of the month water levels are then
    reported for the year of the report along with a proposed plan for the following
    year. Additionally graphs portraying waterfowl use and water levels, then for proposed
    water levels are supplied.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
